INSERT INTO survey_player VALUES (21, 21, 0.00, 21, 1, 1, 'f', 'f', NULL, '', 22, 'männlich', '1.1. So geringe Kosten wie möglich, alles pünktlich zu machen. Effiziente Supply-Chain. Effiziente Transportlogistik
INSERT INTO survey_player VALUES (12, 12, 0.00, 12, 1, 1, 'f', 'f', NULL, '', 21, 'männlich', '1. Ich habe immer geschaut Just-In-Time- Produktion anzuwenden damit keine Lagerkosten anfallen
INSERT INTO survey_player VALUES (4, 4, 0.00, 4, 1, 1, 'f', 'f', NULL, '', 21, 'männlich', '1. Habe immer nur das in die Fertigung gegeben, dass in den nächsten 10 Tagen fertig werden musste, da ich ansonsten logischerweise Lagerkosten hätte. Da dei durchschnittliche Zeit im System nie über 10 Tage war konnte ich dies das ganze Experiment lange machen. 
INSERT INTO survey_player VALUES (23, 23, 0.00, 23, 1, 1, 'f', 'f', NULL, '', 24, 'weiblich', '1. wenn erste zwei Auftrage akzeptieren werden, gibt es keine kosten weil sie mussen nicht im Wartezentrum warten un dsie sind nicht verspaetet. Ich habe nicht meine logik geaendert.
INSERT INTO survey_player VALUES (6, 6, 0.00, 6, 1, 1, 'f', 'f', NULL, '', 23, 'weiblich', '1. leicder anhand der erklärunen nicht genau verstanden wie vorgehen
