INSERT INTO survey_player VALUES (3, 3, 0.00, 3, 1, 1, 'f', 'f', NULL, '', 21, 'männlich', 'leider habe ich ganz zu beginn doch nicht ganz verstande, wie das system funktioniert, später konnte ich dann maßnahmen anwenden um die kosten zu senken.
INSERT INTO survey_player VALUES (9, 9, 0.00, 9, 1, 1, 'f', 'f', NULL, '', 23, 'weiblich', 'Ich bin vom zugesagten Liefertermin ausgegangen und die Differenz vom Auftragseingang genommen. Ich hab sie später geändert und alle Aufträge freigegeben, weil sich die anderen sonst verspätet haben. 
INSERT INTO survey_player VALUES (18, 18, 0.00, 18, 1, 1, 'f', 'f', NULL, '', 24, 'weiblich', 'je knapper das Datum, desto mehr Priorität d.h. diese Aufträge wurden bevorzugt. 
INSERT INTO survey_player VALUES (20, 20, 0.00, 20, 1, 1, 'f', 'f', NULL, '', 24, 'männlich', '1.1 -- ich habe nun die Aufträge die dringend waren freigegeben (10 tage) damit ich keine kosten habe
INSERT INTO survey_player VALUES (13, 13, 0.00, 13, 1, 1, 'f', 'f', NULL, '', 23, 'weiblich', 'da jede Runde aus 10 Tage besteht, hab ich auf das morgige Datum geschaut und dann geschaut welcher Vorgang durchgeführt werden soll damit ich keine Wartezeit im Lager habe aber auch keine davor. 
INSERT INTO survey_player VALUES (8, 8, 0.00, 8, 1, 1, 'f', 'f', NULL, '', 21, 'männlich', '1.1 immer  die ersten 2 freigeben (Liefertermin in 10 Tagen), da hier durch Ausprobieren in der Übungsphase keine Kosten entstanden sind
INSERT INTO survey_player VALUES (22, 22, 0.00, 22, 1, 1, 'f', 'f', NULL, '', 20, 'männlich', 'Das Ziel des Experiments ist es die Kosten möglichst gering zu halten daher hab ich versucht nur solche Aufträge freizugeben welche zeitbezüglich anfallen um kein Lager zu halten.
INSERT INTO survey_player VALUES (1, 1, 0.00, 1, 1, 1, 'f', 'f', NULL, '', 23, 'weiblich', '1. Ich habe mir die durchschnittliche Zeit im System des vergangenen Jahres angesehen und wann der Auftrag hereingekommen ist. Dann habe ich geschaut wann der Liefertermin ist und habe so berechnet wie lang etwa die Wartezeit ist. 
INSERT INTO survey_player VALUES (2, 2, 0.00, 2, 1, 1, 'f', 'f', NULL, '', 19, 'weiblich', '1. Ich habe in den Proberunden probiert zu analysieren, wie viele Kosten bei welcher Freigabeentscheidung verursacht werden. Meine Logik bestand somit darin, zu verstehen welche die Freigabeentscheidung mit den minimalsten Kosten ist und bei dieser zu bleiben.Ich habe meine Logik im Laufe der Durchführungsphase angepasst.
INSERT INTO survey_player VALUES (10, 10, 0.00, 10, 1, 1, 'f', 'f', NULL, '', 19, 'männlich', '1. 1. Ich räumte den dringensten Aufträgen die größte Priorität ein: Aufträge, welche in 10 Tagen fällig waren, wurden daher von mir bevorzugt behandelt. 
INSERT INTO survey_player VALUES (5, 5, 0.00, 5, 1, 1, 'f', 'f', NULL, '', 28, 'weiblich', '1.1. Alle 10 Tage die ersten 2 Aufträge
INSERT INTO survey_player VALUES (17, 17, 0.00, 17, 1, 1, 'f', 'f', NULL, '', 24, 'männlich', '1. Anfangs dachte ich 3 Aufträge zu nehmen um keine Verspätung einzugehen und dafür Lagerkosten in Kauf zu nehmen.
INSERT INTO survey_player VALUES (24, 24, 0.00, 24, 1, 1, 'f', 'f', NULL, '', 24, 'männlich', 'In der Proberunde sind häufig Kosten für Lager und Verspätungen entstanden. Nachdem der erste Auftrag der Hauptrunde ohne Kosten durchgeführt wurde, habe ich diese Strategie beibehalten. Es sind immer 2 Aufträge hinzugekommen, welche in 10 Tagen Ausgeliefert werden mussten. Diese Routine hat sich während des gesamten Prozesses aufrechterhalten. Es sind jeweils 2 Aufträge abgearbeitet worden, und 2 neue hinzugekommen. Aufgrund dieser Tatsache, und der Tatsache dass beim Produktionsprozess nach jeder Runde die Rückmeldung kam, dass keine Kosten entstanden sind, habe ich diese Strategie beibehalten.
INSERT INTO survey_player VALUES (16, 16, 0.00, 16, 1, 1, 'f', 'f', NULL, '', 22, 'weiblich', 'Zu Beginn hin habe ich versucht Verspätungen zu vermeiden. Ich denke jedoch, dass ich das Experiment nicht ganz verstanden habe, da ich laut meiner Logik am Anfang fast keine Verspätungen hatte. Gegen Ende hin habe ich kein Schema mehr befolgt, da ich ohne hin schon zu hohe Kosten hatte. Ich persönlich finde es war etwas schwach erklärt, da ich mir eigentlich nicht dachte, dass es Schwierigkeiten geben könnte, die es dann sehr wohl gegeben hat. ', 'BHS (berufsbildende hohere Schule)', 'Fakultät für Betriebswirtschaft', 'Ja', 8, 6, 5, 3, 4, 4, 4, 4, 4, 6, 5, 4, 6, 6, 6, NULL, 'Es waren nicht wirklich unsicherheiten, es lag daran dass ich das Konzept nicht verstanden habe. ', 5, 4, 4, 5, 5, 6, 2, 't', 't', 't', 't', 't', 4, 1, 1);
INSERT INTO survey_player VALUES (14, 14, 0.00, 14, 1, 1, 'f', 'f', NULL, '', 22, 'männlich', 'Ich habe meine Logik geäandert, denn ich habe gesehen, dass die Kosten niedriger wurden wenn ich frühere Liefertermine gewählt habe. Ich habe die Aufgabe nicht wirklich verstanden.
INSERT INTO survey_player VALUES (7, 7, 0.00, 7, 1, 1, 'f', 'f', NULL, '', 21, 'weiblich', '1.Ich habe mir die Experimentanleitung zu Beginn sehr gut durchgelesen. Dadurch habe ich eigentlich schon sehr gut verstanden, was zu tun ist. Zudem konnte ich bei der Probephase noch einmal einige verschiedene Möglichkeiten ausprobieren und somit habe ich schnell erkannt, dass eigentlich jede Runde 2 Aufträge eingesendet werden müssen, um keine Zusatzkosten bezahlen zu müssen. In der Durchführungsphase musste ich also nicht mehr umbeding so viel nachdenken, ich habe immer zwei Aufträge zur Produktion freigegeben und habe einfach nur darauf geachtet, dass ich alles pünkltich liefern kann. Zudem habe ich auch darauf Acht gegeben, wie die Mengen der zu produzierenden Aufträge war, aber da die Menge immer eins war, musste ich meine Strategie nicht verändern. 
INSERT INTO survey_player VALUES (15, 15, 0.00, 15, 1, 1, 'f', 'f', NULL, '', 26, 'männlich', '1. kein Risiko
INSERT INTO survey_player VALUES (19, 19, 0.00, 19, 1, 1, 'f', 'f', NULL, '', 24, 'weiblich', 'Ich habe mir überlegt, was die durchschnittliche Zeit im System aussagt - ich habe absolut nicht verstanden, warum immer ~ 90 Tage zwischen Auftragseingang und zugesagtem Liefertermin lagen. Es hätte mehr Sinn gemacht, wenn die durchschnittliche Zeit auszurechnen gewesen wäre. 
INSERT INTO survey_subsession VALUES (1, 1, 1);
